function words({w1,w2,w3,username,drawer}){
    return(
        <div>
        {username==drawer ?
            <div>
            <h2>
                {w1}
                {w2}
                {w3}
              
            </h2>
        </div> :<div>
            <h2>Words not visible to you</h2>
        </div>
        }
        </div>
    )
}

export default words;
